                ss << u8"    \"koKR\": \"물약을 초상화에 놓아 치유\",\n";
                ss << u8"    \"plPL\": \"Upuść miksturę na portrecie, aby dokonać leczenia\",\n";
                ss << u8"    \"esMX\": \"Suelta la poción sobre el retrato para sanar\",\n";
