                ss << u8"    \"koKR\": \"GDI는 래스터화 소프트웨어를 가상으로 구동합니다.\\nGlide는 원작의 3DFX 필터링을 가상으로 구동합니다.\\n레저렉션은 3DFX 모드의 설정을 지원합니다.\",\n";
